    class Ball {
        constructor(x, y, context, path) {
            this.x = x;
            this.y = y;
            this.context = context;
            this.path = path;
            this.radius = 15;
            this.speed = 1;
            this.color = (Math.random() < 0.5) ? 'red' : 'blue';
            this.run = 0;
            this.next = 0;
        }

        draw() {
            this.context.fillStyle = this.color;
            this.context.beginPath();
            this.context.arc(this.x, this.y, this.radius, 0, Math.PI * 2, false);
            this.context.fill();
        }

        update() {
            this.next++;
            if (this.path.length < 2)
                return;
            if (this.run >= this.path.length)
                this.run = 0;
            if (this.run === 0) {
                this.x = this.path[0].x;
                this.y = this.path[0].y;
                this.run++;
            } else {
                let angle = Math.atan2(this.path[this.run].x - this.x, this.path[this.run].y - this.y);
                if (Math.abs(this.x - this.path[this.run].x) < this.speed &&
                    Math.abs(this.y - this.path[this.run].y) < this.speed) {
                    this.x = this.path[this.run].x;
                    this.y = this.path[this.run].y;
                    this.run++;
                } else {
                    this.x += Math.sin(angle) * this.speed;
                    this.y += Math.cos(angle) * this.speed;
                }
            }
        }
    }

    let balls = []

    function getBall() {
        let ball = new Ball(obj1[0].x, obj1[0].y, context, obj1);
        if (balls.length < 25) {

            balls.push(ball);
        }
    }
    getBall();

    function go() {
        let image = new Image();
        image.src = './storage/levels/1-1/Spiral.jpg';
        context.drawImage(image, 0, 0, 800, 600);
        context.fill();
        if (balls[balls.length - 1].next === 35) {
            getBall();
        }

        for (let i = 0; i < balls.length; i++) {

            balls[i].draw();
            balls[i].update();
        }
        window.requestAnimationFrame(go);
    }

    go();
